import "./style.css";
import { socialsArr } from "../../data/socials";

export default function Socials() {
console.log(process.env)
  return (
    <div id="socials">
      <ul>
        {socialsArr.map((item) => {
          if (item.icon) {
            return (
              <li>
                <a href={item.link}>
                  <i className={item.icon}></i>
                </a>
              </li>
            );
          } else {
            return <></>;
          }
        })}
      </ul>
    </div>
  );
}
